import "./Expenses.css";


const ExpenseList = (props) => {

    if (props.items.length === 0) {
        return <h2>Found Nothing</h2>
    }
    return (
        <ul className="expense-list">
        {
            props.items.map((expense) => (
                <ExpenseItem
                    key={expense.id}
                    title={expense.title}
                    amount={expense.amount}
                    date={expense.date}
                />
            ))
        }
</ul>
)
}
export default ExpenseList;
